import React from 'react';

function ProgressBar(props){
    return(
        <div className = "completed-bar">
            <div className = "custom-bar custom-bar-label" style={{width: `${props.percent}`}} >
                <p>{props.label}</p>
                <span>{props.percent}</span>
            </div>
        </div>
    );
}

export default ProgressBar;
